This scarcity is attributed to the recyclable nature of silver. Historically, raw silver was scarce, leading craftsmen to melt down old or damaged pieces to create new designs. This cycle of melting and reshaping—which continued through various reigns and as recently as 2025—has effectively erased the physical "design trail" of Kotagede’s earliest silver masterpieces.', true, '2026-01-12 10:12:46.137+00', '{}', false, 'c815afc1-3f72-4a58-a4d6-0b475433c58e', '2026-01-12 10:11:23.520516+00', NULL, 49),
	('3bdc42ab-d244-4528-9410-2026a4255768', 'rekor-perak-pecah-rekor-panduan-pantau-harga-real-time-dalam-rupiah', 'Harga Perak Pecah Rekor: Panduan Pantau Harga Real-Time dalam Rupiah', 'Harga perak berhasil memecahkan rekor tertinggi. Simak panduan lengkap memantau pergerakan harga secara real-time dalam Rupiah untuk membantu Anda mengoptimalkan momentum investasi logam mulia yang sedang sangat menjanjikan saat ini.', '<p>Belakangan ini, pasar logam mulia dunia sedang memanas dengan harga perak yang mencatatkan rekor tertinggi sepanjang masa (All-Time High). Data terbaru menunjukkan lonjakan nilai yang luar biasa, mencapai kenaikan hampir 160% sejak awal tahun 2025. Bahkan dalam satu bulan terakhir saja, tercatat pertumbuhan lebih dari 30%. Sentimen ini sebagian besar didorong oleh meningkatnya ketegangan geopolitik global, seperti friksi antara Amerika Serikat dan Venezuela, yang memicu gelombang permintaan investor terhadap aset "safe-haven" atau pelindung nilai.<br><br>Volatilitas pasar pun sangat terasa. Sempat menyentuh level tertinggi, harga perak sempat mengalami koreksi sedikit di bawah level $80 per troy ounce pada awal Januari, sebuah pergerakan yang memutus tren kenaikan beruntun selama beberapa hari. Rick Kanda, Managing Director dari The Gold Bullion Company, menyoroti bahwa meskipun perak memiliki volatilitas yang lebih tinggi dibandingkan emas karena besarnya permintaan industri dan ukuran pasar yang lebih kecil, perak tetap menjadi titik masuk investasi yang sangat menarik. Harganya yang lebih terjangkau dibandingkan emas menjadikannya pilihan strategis bagi investor pemula maupun kolektor yang ingin melakukan diversifikasi portofolio sekaligus lindung nilai terhadap inflasi.<br><br>Namun, di tengah antusiasme dan pergerakan harga yang cepat ini, ada satu kendala yang sering dialami oleh masyarakat Indonesia: sulitnya mencari sumber informasi harga perak yang akurat, relevan, dan <em>real-time</em>.<br><br>Mayoritas referensi harga perak dunia disajikan dalam mata uang Dolar AS (USD) per troy ounce. Bagi kita yang bertransaksi di pasar lokal, konversi manual ke Rupiah (IDR) per gram seringkali membingungkan karena fluktuasi kurs mata uang yang juga bergerak setiap detik. Selain itu, banyak situs lokal yang menyajikan harga perak namun dengan pembaruan data yang lambat—terkadang hanya diperbarui sekali sehari. Padahal, di saat volatilitas tinggi seperti sekarang dimana harga bisa berubah drastis dalam hitungan jam, keterlambatan informasi bisa berarti hilangnya peluang.<br><br>Menjawab kebutuhan tersebut, Salim Silver kini menghadirkan fitur baru di situs web kami: Halaman Live Harga Perak.<br><br>Kami memahami bahwa transparansi dan kecepatan data adalah kunci. Oleh karena itu, halaman ini dirancang khusus untuk menyajikan:</p><ol><li><p>1. <strong>Harga Perak dalam Rupiah (IDR)</strong>: Tidak perlu lagi repot menghitung kurs sendiri.</p></li><li><p>2. <strong>Satuan Gram</strong>: Satuan yang paling umum digunakan dalam transaksi perhiasan dan batangan di Indonesia.</p></li><li><p>3. <strong>Update Berkala</strong>: Data harga yang diperbarui secara otomatis dan sering (real-time/near real-time), sehingga Anda tidak akan tertinggal momentum pasar.</p></li><li><p><br></p></li><li><p>Entah Anda sedang merencanakan untuk menambah koleksi perhiasan perak Salim Silver, atau sekadar memantau nilai aset Anda di tengah tren kenaikan harga saat ini, halaman ini akan menjadi referensi andalan Anda.<br><br>Jangan sampai terlewat momen penting di pasar perak. Cek harga perak terkini, akurat, dan terpercaya langsung di website Salim Silver.<br><br><a target="_blank" rel="noopener noreferrer nofollow" class="text-primary underline hover:text-primary/80" href="https://salimsilver.com/silver-price">Kunjungi Halaman Harga Perak</a></p></li></ol><p></p>', 'https://ckrypbqakgmeujbdmeks.supabase.co/storage/v1/object/public/blog/blog/1767944220100-GeminiGeneratedImagehrtabbhrtabbhrta.webp', 'Harga Perak Pecah Rekor: Panduan Pantau Harga Real-Time dalam Rupiah | Salim Silver', 'Di tengah lonjakan harga perak dunia yang mencatatkan rekor tertinggi sepanjang masa (ATH) dengan kenaikan 160% sejak awal 2025, Salim Silver menghadirkan solusi berupa fitur Halaman Live Harga Perak dalam Rupiah (IDR) per gram untuk memudahkan investor Indonesia. Ketegangan geopolitik global telah mendorong harga perak menembus level signifikan, namun volatilitas yang tinggi menuntut akses data yang cepat dan akurat. Fitur terbaru dari Salim Silver ini menjawab kebutuhan pasar akan informasi harga perak real-time yang relevan dengan transaksi lokal, sehingga para kolektor dan investor dapat mengambil keputusan strategis secara instan tanpa perlu repot melakukan konversi kurs manual atau tertinggal momentum pasar.', true, '2026-01-09 07:37:13.942+00', '{"silver price","harga perak rupiah","rekor harga perak"}', false, 'da94210b-5152-497a-8634-3fc5b3b0178c', '2026-01-09 07:37:03.767585+00', NULL, 23),
	('687d7a81-9112-4b20-ba9d-b8f914eed30d', 'bukti-karya-kerajinan-perak-kotagede-tertua', 'Bukti Karya Kerajinan Perak Kotagede Tertua', 'Menelusuri jejak fisik kerajinan perak tertua di Kotagede yang berasal dari era Sultan Hamengkubuwono VII. Artikel ini mengungkap bukti sejarah berupa baki dan peralatan perak yang mencerminkan kejayaan budaya Yogyakarta.', '<p>Seperti yang kami tulis di artikel <a target="_blank" rel="noopener noreferrer nofollow" class="text-primary underline hover:text-primary/80" href="https://salimsilver.com/id/blog/perak-mendeteksi-perubahan-kesehatan-tubuh">halaman ini,</a> yang mempertanyakan bukti nyata karya perak Kotagede yang ceriteranya dimulai pada abad XVI tapi sampai saat ini belum ditemukannya bukti fisik karya kerajinan perak Kotagede abad XVI, maka ada pertanyaan berikutnya: Bukti benda kerajinan perak karya perajin Kotagede tertua itu kira-kira ada tidak ya?<br><br>Sejauh yang pernah penulis lihat adalah ada beberapa hasil kerajinan perak tua dari kriyawan Kotagede yang di produksi pada era Sri Sultan Hamengkubuwono VI. Bukti pertama karya perak yang wujudnya baki perak yang di bikin Sri Sultan Hamengkubuwono VI dalam rangka ulang tahunnya pada tahun 1875.<br><br></p><div data-type="image-wrapper" style="display: flex;"><div data-type="image-container" style="position: relative; width: 499px; margin: 0px auto;"><img src="https://ckrypbqakgmeujbdmeks.supabase.co/storage/v1/object/public/blog/blog/content/1768987005347-260121HBVI.png" width="499"></div></div><p><br><br>Bukti ke dua adalah sebuah karya perak yang wujudnya kecohan dengan ukuran lingkaran atas 16 cm dan tinggi 17 cm berat 430 gram. Kecohan adalah wadah penampung sisa raja atau ratu saat mereka melakukan ritual menginang. Kecohan ini tidak ada tanda yang secara pasti merujuk jika kecohan ini di bikin saat era Sri Sultan Hamengkubuwono VII. Cuma jika dicocokan dengan foto-foto yang beredar di internet saat Sri Sultan Hamengkubuwono VII duduk di kursi singgasana di dekatnya ada meja di mana kecohan ini diletakkan, maka kecohan ini memiliki kemiripan. Di samping itu kecohan ini ditemukan dengan bukti ke tiga yang memiliki catatan nyata.<br><br></p><div data-type="image-wrapper" style="display: flex;"><div data-type="image-container" style="position: relative; width: 430px; margin: 0px auto;"><img src="https://ckrypbqakgmeujbdmeks.supabase.co/storage/v1/object/public/blog/blog/content/1768987470312-260121Kecohan.png" width="430"></div></div><p><br><br>Bukti ke tiga adalah sepasang alat perak yang berwujud tatakan bersegi 4 semacam baki kecil ukuran 24,5 cm x 24,5 cm 435 gram dan satu mangkuk perak diameter 18 cm tinggi 9 cm berat 393 gram. <br><br></p><div data-type="image-wrapper" style="display: flex;"><div data-type="image-container" style="position: relative; width: 500px; margin: 0px auto;"><img src="https://ckrypbqakgmeujbdmeks.supabase.co/storage/v1/object/public/blog/blog/content/1768987561248-DSC8828A.jpg" width="500"></div></div><p><br><br>Di bawah tatakan atau baki bersegi 4 ini terdapat inskripsi (tulisan yang permanen pada suatu benda, seperti batu, logam, atau kayu, yang berfungsi sebagai catatan sejarah, peringatan, atau informasi penting). Inskripsi berhuruf Jawa:<br><br></p><div data-type="image-wrapper" style="display: flex;"><div data-type="image-container" style="position: relative; width: 467px; margin: 0px auto;"><img src="https://ckrypbqakgmeujbdmeks.supabase.co/storage/v1/object/public/blog/blog/content/1768987502961-260121BRAMurjilin.jpeg" width="467"></div></div><p><br><br>Inskripsi di bawah baki perak itu dalam huruf Jawa jika ditulis dalam huruf Latin: Bandara Raden Ajeng Murjilin. Siapakah Bandara Raden Ajeng Murjilin? Jika kita telusuri dalam <a target="_blank" rel="noopener noreferrer nofollow" class="text-primary underline hover:text-primary/80" href="https://www.sastra.org/arsip-dan-sejarah/umum/3186-sajarah-dalem-pangiwa-lan-panengen-padmasusastra-1902-1122">halaman ini.</a> Bendara Raden Ayu Murjilin adalah puteri dari Sultan Hamengkubuwono VII dari salah satu garwo selir Bendara Raden Ayu Pujaretna.<br><br>Ketiga benda kerajinan perak ini diperoleh dari sumber yang sama, dengan demikian bisa disimpulkan bahwa ketiga karya kerajinan perak ini kemungkinan besar memiliki tahun yang sama dalam pembuatannya, yaitu masa pemerintahan Sultan Hamengkubuwono VII tahun 1877 sampai dengan 1921, masa terpanjang kekuasaan Sultan yang pernah berkuasa di keraton Yogyakarta. Pada masa ini terkenal sebagai masa kemakmuran dan modernisasi Yogyakarta.<br><br>Pada masa ini secara ekonomi kasultanan Yogyakarta mengalami masa puncak kemakmuran dengan adanya pembangunan 17 pabrik gula, jaringan kereta api, pendirian sekolah-sekolah modern dan lain lainnya. Bahkan pada masa ini Sultan dikenal sebagai Sultan Sugih (kaya) atau Sultan Behi karena hasil keuntungan pabrik gula. Dari keuntungan pabrik gula ini dilakukan perbaikan kraton dan rakyat yang hasilnya adalah kemajuan bagi Yogyakarta menuju modernisasi.<br><br>Periode Sultan Hamengkubowono VII ini merupakan masa transisi menuju modernisasi dengan dihapusnya tanam paksa (cultuurstelsel) diganti dengan sistim ekonomi liberal, dan juga kesadaran Sultan Hamengkubuwono VII terhadap pendidikan keluarganya sehingga banyak mengirim putra-putranya untuk belajar di Belanda. Dari pemikiran maju inilah Yogyakarta semakin mengalami kemajuan yang berarti dari sisi budaya dan ekonomi. Pada masa inilah pembangunan renovasi Tugu Golong Gilig 1889, juga pembangunan pesanggrahan Ambarukmo.<br><br>Dari sisi seni budaya pada masa inilah munculnya Tari Bedaya Sumreg, Srimpi Dhendhang Sumbawa, dan Bedaya Lala, serta pembuatan keris tangguh (masa) kaping piton. Jadi sangat rasional sekali jika perkembangan kerajinan perak Kotagede juga berkembang pada saat pemerintahan Sultan Hamengkubuwono VII, dan bukti-bukti karya kerajinan perak Kotagede itu masih bisa diketemukan walau semakin sulit akhir-akhir ini. &nbsp;</p>', 'https://ckrypbqakgmeujbdmeks.supabase.co/storage/v1/object/public/blog/blog/1769009255868-lossypage11552pxKITLV10003KassianCephasJavanesewomenincourtdressbelongingtothefamilyofHamengkoeBuwonoVIIsultanofYogyakartaAround1885.tif.webp', 'Bukti Karya Kerajinan Perak Kotagede Tertua', 'Menelusuri jejak fisik kerajinan perak tertua di Kotagede yang berasal dari era Sultan Hamengkubuwono VII. Artikel ini mengungkap bukti sejarah berupa baki dan peralatan perak yang mencerminkan kejayaan budaya Yogyakarta.', true, '2026-01-21 10:20:27.677+00', '{"Hamengkubuwono VII","sejarah kotagede"}', false, 'c815afc1-3f72-4a58-a4d6-0b475433c58e', '2026-01-21 09:15:16.874639+00', '2026-01-21 15:43:43.13+00', 14),
	('b4b85aaa-af30-477c-b447-317c031e93f1', 'perak-mendeteksi-perubahan-kesehatan-tubuh', 'Perak Mendeteksi Perubahan Kesehatan Tubuh', 'Temukan kaitan menarik antara logam perak dan kesehatan manusia. Artikel ini membahas bagaimana peralatan makan perak dapat mendeteksi perubahan metabolisme tubuh melalui reaksi warna yang dipicu oleh kondisi saliva pemakainya.', '<p>Jika ternyata perak Kotagede yang dibuat pada masa Panembahan Senopati tidak bisa kita ketemukan bukti fisiknya, terus kira-kira sebenarnya pada masa kapan kerajinan perak Kotagede mulai berkembang di Kotagede? Pembahasan mendalam mengenai hal ini dapat Anda simak <a target="_blank" rel="noopener noreferrer nofollow" class="text-primary underline hover:text-primary/80" href="https://salimsilver.com/id/blog/benarkah-budaya-kerajinan-perak-kotagede-dimulai-sejak-senopati">di sini.</a> Jawabannya tentu bisa ada bermacam-macam versi jawaban. Untuk mendekati kebenaran tentu jawaban itu harus didukung fakta yang ada, misalnya diketemukannya perak yang dibikin pada masa tertentu dengan keterangan yang pasti.<br><br>Apa yang ditulis di sini bukan menyalahkan pendapat yang mengatakan bahwa perak Kotagede dimulai pada jaman Panembahan Senopati pada abad XVI, tetapi mengajak berpikir secara rasional bahwa suatu pendapat membutuhkan fakta untuk mendukungnya. Sampai saat ini belum diketemukan benda perak yang merupakan kerajinan perak Kotagede yang dibikin pada abad XVI. Jika suatu saat bisa diketemukan kerajinan perak yang dibuat pada masa pemerintahan Panembahan Senopati maka pendapat bahwa budaya kerajinan perak Kotagede dimulai sejak abad XVI akan meyakinkan generasi saat ini bahwa kerajinan perak Kotagede dimulai sejak era Panembahan Senopati.<br><br>Suatu saat penulis pernah mengikuti suatu Focus Grup Discussion di Kotagede dengan nara sumber seorang penggiat pariwisata Yogyakarta. Beliau berceritera bahwa kerajinan perak Kotagede dimulai pada jaman pemerintahan Panembahan Senopati karena Panembahan Senopati mempunyai banyak musuh dalam selimut. Dengan menggunakan piring dan sendok dari perak, Panembahan Senopati bisa mendeteksi jika makanan beliau diberi racun oleh musuh-musuh dalam selimutnya. Menurut penggiat pariwisata Yogyakarta itu jika ada racun dalam makanan yang disajikan kepada Panembahan Senopati maka piring yang digunakan akan berubah warnanya karena terkena racun dalam makanan yang disajikan.<br><br>Saat itu penulis menanyakan bukti piring perak yang digunakan pada jaman Panembahan Senopati itu apakah masih bisa kita temukan atau tersimpan di museum mana? Piring perak itu dihiasi dengan ukiran dengan design apa? Benarkah piring perak dapat mendeteksi racun makanan yang di taruh di piring itu? Penggiat pariwisata Yogyakarta itu tidak dapat menjawab, dan akhirnya beliau menjawab bahwa pernyataan budaya perak dimulai sejak jaman Panembahan Senopati karena piring perak digunakan untuk mendeteksi racun itu hanyalah bahasa guide untuk menarik wisatawan yang berkunjung ke Kotagede.<br><br>Benarkah alat makan yang dibikin dari perak bisa berubah warna karena racun?<br><br>Suatu saat penulis mendapat tamu dari Belanda yang berkunjung ke Salim Silver. Tamu dari Belanda yang sudah berusia itu ternyata mempunyai interes pada perak Kotagede. Pada kenyataannya sejarah perak Kotagede mempunyai kaitan dengan peran orang Belanda di masa penjajahan. Saat penulis menceriterakan mengenai sejarah kerajinan perak Kotagede menurut versi guide, bahwa perak bisa mendeteksi racun, dia menjelaskan memang ada kaitannya antara kesehatan dengan alat makan dari perak.<br><br>Dia menceriterakan di negara Belanda seseorang bisa mendeteksi kesehatannya dengan cara memakai sendok makan dari perak. Menurutnya jika seseorang menggunakan sendok perak setiap hari untuk makan, artinya dia memakai sendok yang digunakannya sendiri, tidak digunakan anggota keluarga lain di rumah yang sama. Jika tubuhnya mengalami perubahan metabolisme maka saliva di mulutnya akan ada perubahan. Dengan saliva yang berubah maka akan mempengaruhi warna sendok makan yang selalu dipakai. Artinya sendok makan perak akan bisa mendeteksi dalam waktu lama perubahan saliva karena adanya perubahan metabolisme tubuh pemakai sendok itu.<br><br>Dari dua pendapat di atas sepertinya lebih logis pendapat yang mengatakan bahwa alat makan (sendok) yang dibikin dari perak bisa membantu mendeteksi kesehatan tubuh pemakai sendok perak itu.</p>', 'https://ckrypbqakgmeujbdmeks.supabase.co/storage/v1/object/public/blog/blog/1768557310864-PiringPerak.jpg', 'Perak Mendeteksi Perubahan Kesehatan Tubuh', 'Bukti fisik perak Kotagede era Panembahan Senopati belum ditemukan, sehingga narasi pendeteksi racun dianggap sekadar mitos wisata. Secara rasional, perak lebih logis berfungsi sebagai indikator kesehatan jangka panjang melalui reaksi kimia terhadap saliva yang dipengaruhi oleh perubahan metabolisme tubuh pemakainya.', true, '2026-01-16 10:04:11.99+00', '{"budaya perak","sejarah perak Kotagede","perak dan kesehatan"}', false, 'c815afc1-3f72-4a58-a4d6-0b475433c58e', '2026-01-16 10:02:53.067002+00', '2026-01-16 10:15:39.983+00', 46);


